import {Main,OuterContainer,InnerContainer,CenteredMain} from './components/MainContainer'
import {Header} from './components/Header'
import React from 'react';

function App() {
  return (
    <OuterContainer>       
      <Main>
        <InnerContainer>
         <CenteredMain>
           <Header />         
         </CenteredMain>             
        </InnerContainer>
      </Main>
    </OuterContainer>

  );
}

export default App;
